import React, {Component} from "react";

import Box from '@mui/material/Box';
import Slider from '@mui/material/Slider';

class Home extends Component {

    constructor() {
        super();
        this.state = {
            value: 20,
            setValue: 37,
        }
    }

    marks = [
        {
            value: 0,
            label: '0°C',
        },
        {
            value: 20,
            label: '20°C',
        },
        {
            value: 37,
            label: '37°C',
        },
        {
            value: 100,
            label: '100°C',
        },
    ];


    valuetext(value) {
        return `${value}°C`;
    }

    RangeSlider() {

        const [value, setValue] = [this.state.value, this.state.setValue];

        const handleChange = (event, newValue) => {
            this.setState({value: newValue })

        };
    }

        render()
        {
            return (
                <div>
                    <h1>Settings</h1>
                    <p>Please choose your settings:</p>
                    <Box sx={{width: 300}}>
                        <Slider
                            getAriaLabel={() => 'Temperature range'}
                            value={this.state.value}
                            onChange={this.handleChange()}
                            valueLabelDisplay="auto"
                            getAriaValueText={this.valuetext}
                        />
                    </Box>
                </div>
            )
        }

}

export default Home;
